988.597c0-.165.099-.26.259-.26.099 0 3.986 2.463 4.22 2.607l.609.38c.193-.13.387-.24.587-.375.408-.26 4.038-2.612 4.138-2.612.16 0 .26.095.26.26 0 .174-.337.348-.557.482-1.378.841-2.756 1.757-4.122 2.628-.08.054-.233.17-.35.151-.128-.019-4.083-2.56-4.802-2.983-.108-.064-.242-.123-.242-.278\" fill-rule=\"evenodd\"></path></svg></a></div></div></div><div class=\"article-single__content category_contents_details\" style=\"line-height: 1.8; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal; background-color: rgb(255, 255, 255);\"><h1 class=\"mb-40\" style=\"margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 36px; line-height: 1.33;\">Bitcoin and Ethereum Correct Gains, APE Crashes 40%</h1><div class=\"dslot text-right\" did=\"9\" style=\"max-height: 60px; overflow: hidden; text-align: right !important;\"><a href=\"https://rapi.cryptonews.com/outgoing/127/1\" rel=\"nofollow\" target=\"_blank\" style=\"color: rgb(89, 0, 138); background-color: transparent;\"><img alt=\"\" class=\"img-fluid\" loading=\"auto\" srcset=\"https://v2.cimg.co/other/127/25235/responsive-images/en-prime-buttom-1___media_library_original_239_31.png 239w\" src=\"https://v2.cimg.co/other/127/25235/en-prime-buttom-1.png\" width=\"239\" style=\"border-style: none;\"></a></div><figure class=\"image\" style=\"margin-top: 40px; margin-bottom: 40px;\"><img src=\"https://v2.cimg.co/news/74130/169692/1.jpg\" alt=\"\" srcset=\"https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_1280_853.jpg 1280w, https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_1200_800.jpg 1200w, https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_900_600.jpg 900w, https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_720_480.jpg 720w, https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_600_400.jpg 600w, https://v2.cimg.co/news/74130/169692/responsive-images/1___media_library_original_300_200.jpg 300w\" sizes=\"100vw\" width=\"1280\" class=\"content-img\" style=\"border-style: none; margin-bottom: 10px; max-width: 100%;\"></figure><p style=\"margin-bottom: 30px;\">&nbsp;</p><ul><li>Bitcoin price started a downside correction from USD 42,250.</li><li>Ethereum failed to clear USD 3,000, XRP is trading around USD 0.80.</li><li>The hyped APE keeps trending down.</li></ul><p style=\"margin-bottom: 30px;\">Bitcoin price attempted an upside break above the USD 42,250 resistance zone but failed. BTC started a downside correction and is currently (04:18 UTC) trading near USD 40,800.</p><p style=\"margin-bottom: 30px;\">Similarly, most major altcoins are also moving lower.&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://www.tradingview.com/symbols/ETHUSD/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">ETH</a>&nbsp;failed to surpass USD 3,000 and declined below USD 2,900. XRP tested USD 0.82 before correcting lower. ADA failed to clear the key USD 0.92 resistance zone.</p><p style=\"margin-bottom: 30px;\"><span style=\"font-weight: bolder;\">Total market capitalization</span></p><figure class=\"image\" style=\"margin-top: 40px; margin-bottom: 40px;\"><img src=\"https://v2.cimg.co/news/74130/169693/screenshot-2022-03-21-at-06-33-57-crypto-market-cap-and-defi-market-cap-charts-tradingview.jpg\" alt=\"\" width=\"\" class=\"content-img lazyloaded\" data-src=\"https://v2.cimg.co/news/74130/169693/screenshot-2022-03-21-at-06-33-57-crypto-market-cap-and-defi-market-cap-charts-tradingview.jpg\" data-srcset=\"\" style=\"border-style: none; margin-bottom: 10px; max-width: 100%;\"><figcaption>Source: tradingview.com</figcaption></figure><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25;\">Bitcoin price</h2><p style=\"margin-bottom: 30px;\">After a failed attempt to clear the USD 42,250 resistance,&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/bitcoin/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">bitcoin price</a>&nbsp;started a downside correction. It is now trading below USD 41,000 and might continue to move lower towards USD 40,500. The main weekly support is near the USD 40,000 level, below which the price may perhaps revisit the USD 39,000 support zone.</p><p style=\"margin-bottom: 30px;\">If there is a fresh increase, the price might face resistance near USD 41,250. The next key resistance is near the USD 42,250 level, above which the price could gain bullish momentum.</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25;\">Ethereum price</h2><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/ethereum/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">Ethereum price</a>&nbsp;attempted to gain pace above USD 2,950 but faced a strong resistance. ETH is now moving lower and trading below USD 2,900. The next major support is near the USD 2,800 level, below which the price might test the USD 2,750 support zone.</p><div class=\"dslot row mb-60 \" did=\"5\" style=\"margin-right: -15px; margin-left: -15px; margin-bottom: 60px;\"><a href=\"https://rapi.cryptonews.com/outgoing/117/1\" rel=\"nofollow\" target=\"_blank\" style=\"color: rgb(89, 0, 138); background-color: transparent;\"><img alt=\"\" class=\"img-fluid\" loading=\"auto\" srcset=\"https://v2.cimg.co/other/117/25957/responsive-images/1160x90___media_library_original_1160_90.jpg 1160w, https://v2.cimg.co/other/117/25957/responsive-images/1160x90___media_library_original_900_69.jpg 900w, https://v2.cimg.co/other/117/25957/responsive-images/1160x90___media_library_original_720_55.jpg 720w, https://v2.cimg.co/other/117/25957/responsive-images/1160x90___media_library_original_600_46.jpg 600w, https://v2.cimg.co/other/117/25957/responsive-images/1160x90___media_library_original_300_23.jpg 300w\" src=\"https://v2.cimg.co/other/117/25957/1160x90.jpg\" width=\"1160\" style=\"border-style: none;\"></a></div><p style=\"margin-bottom: 30px;\">On the upside, an initial resistance is near the USD 2,900 level. The next major hurdle is now forming near the USD 2,950 level.&nbsp;</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25;\">ADA, BNB, SOL, DOGE, and XRP price</h2><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/cardano/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">Cardano (ADA)</a>&nbsp;traded above the USD 0.90 resistance zone. However, it failed to clear the USD 0.92 resistance zone. It is now back below USD 0.90 and might decline towards the USD 0.865 support.</p><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/binance-coin/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">BNB</a>&nbsp;extended gains above the USD 388 resistance level. It even spiked above the USD 400 resistance level. However, there was no upside continuation and the price declined below USD 390 again.</p><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/sol-solana/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">Solana (SOL)</a>&nbsp;failed to clear the USD 92 resistance zone. If there is a downside break below the USD 85 support, the price might move down. In this case, SOL may perhaps decline towards USD 78.</p><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/dogecoin/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">DOGE</a>&nbsp;gained pace above the USD 0.120 resistance. It traded close to the key USD 0.124 resistance level, where the bears emerged. The price is trimming gains and might test the USD 0.118 support zone.</p><p style=\"margin-bottom: 30px;\"><a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/ripple/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">XRP price</a>&nbsp;spiked above the USD 0.80 resistance. It faced a strong selling interest and there was no close above USD 0.82. The price is now moving lower and approaching the USD 0.788 support zone. Any more losses might push the price towards USD 0.768.</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25;\">Other altcoins market today</h2><p style=\"margin-bottom: 30px;\">Many altcoins are in the red zone, including AVAX, DOT, SHIB, MATIC, NEAR, LINK, UNI, MANA, ICP, SAND, FTM, and MIOTA. Conversely, DASH is up almost 9% and trading above USD 110. Meanwhile, the&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/news/apecoin-soars-after-launch-bayc-nft-prices-pumps-dumps.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">newly emerged APE</a>&nbsp;is now down 40% since its peak reached last Friday as it keeps trending lower and is trading near USD 10. Its down 10% in a day.</p><p style=\"margin-bottom: 30px;\">Overall, bitcoin price is slowly moving lower from the USD 42,250 resistance level. BTC might even drop below the USD 40,500 level, but the USD 40,000 support is the key for the next increase.</p></div>', NULL, '2022-03-21 07:32:59', 1, 'li-finance-protocol-loses-600000-in-latest-defi-exploit-1000x700.png', 'li-finance-protocol-loses-600000-in-latest-defi-exploit-600x400.png', 'li-finance-protocol-loses-600000-in-latest-defi-exploit-150x150.png', '2022-03-21 04:34:44', '2022-03-22 09:30:28', '<br>', NULL),
(3, 'the-ukraine-war-how-russia-s-aggression-affected-bitcoin-crypto-and-what-might-happen-next', 1, 'The Ukraine War: How Russias Aggression Affected Bitcoin & Crypto and What Might Happen Next', NULL, '<br>', '<p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">More than three weeks in and the&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/tags/ukraine-war\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">Ukraine-Russia war</a>&nbsp;is still raging, despite negotiations over a possible peace settlement. While the human costs of the war are something that can never be repaid, the war has also had a noticeable impact on the global economy and financial markets, including the crypto market.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Back in January, analysts&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/exclusives/heres-how-ukraine-crisis-might-impact-bitcoin-crypto-market.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">predicted</a>&nbsp;that direct armed conflict between Russia and Ukraine could result in significant losses for&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/coins/bitcoin/\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">bitcoin (BTC)</a>&nbsp;and other cryptoassets. This has been borne out to some extent by the ensuing war, with the price of bitcoin initially responding to Russias invasion on Thursday February 24 with a 7% drop from about USD 37,500 to USD 34,740.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">However, bitcoin has since recovered to a price of around USD 40,600 (as of writing), with industry figures telling&nbsp;<i>Cryptonews.com</i>&nbsp;that the war has, to some extent, strengthened the idea of the cryptocurrency as an alternative to fiat currencies, as well as stocks. But, while some say that the ongoing war could enhance the relative value of bitcoin, its longer term effects on the global economy may continue to drag down the crypto market for some time.</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25; font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">War, inflation, and interest rates</h2><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Analysts tend to affirm that the see-sawing stagnation of the crypto market at the moment is the result of several factors, and not just the Ukraine war.</p><blockquote style=\"margin-bottom: 40px; color: rgb(89, 0, 138); padding: 20px 0px 20px 28px; border-left: 2px solid rgb(89, 0, 138); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\"><p style=\"margin-bottom: 10px; font-family: &quot;Noto Serif&quot;, serif; font-size: 20px; font-style: italic;\">Investors will generally rotate out of perceived riskier assets when uncertainty arises. That\'s why weve seen cryptoassets come under pressure on occasions during this war when tensions have escalated, said&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://rapi.cryptonews.com/ext/etoro/en\" style=\"color: rgb(89, 0, 138); background-color: transparent;\"><span style=\"font-weight: bolder;\">eToro</span></a>&nbsp;senior analyst Simon Peters.</p></blockquote><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Despite acknowledging the impact of the war on the crypto market, Peters suggests that its the pre-existing state of the global economy thats mostly responsible for dragging it down. He also notes that, historically, crypto has witnessed a bear market of some kind roughly every four years or so, with the last being in 2018.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">High inflation and slowing growth in the developed economies such as the US could be weighing on sentiment also, as investors look for clarity from central banks as to what policy decisions will be made to combat these, he told&nbsp;<i>Cryptonews.com</i>.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">This is more or less the consensus view among analysts, with&nbsp;<span style=\"font-weight: bolder;\">Bloomberg Intelligence</span>s Mike McGlone also suggesting that the crypto market needs some time to cool down after ballooning in the midst of a global speculative and inflation frenzy last year.</p><blockquote style=\"margin-bottom: 40px; color: rgb(89, 0, 138); padding: 20px 0px 20px 28px; border-left: 2px solid rgb(89, 0, 138); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\"><p style=\"margin-bottom: 10px; font-family: &quot;Noto Serif&quot;, serif; font-size: 20px; font-style: italic;\">Declining cryptos are part of the ebbing tide and the US stock market is a primary extended asset at risk of normal reversion, notably as the market faces central banks focused on reducing inflation. Assets that have rallied too much are at greater risk of reversion, he told&nbsp;<i>Cryptonews.com</i>, before suggesting that altcoins are at greater risk than bitcoin.</p></blockquote><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Again, most analysts point to the fact that bitcoin and other cryptoassets seem to be&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/news/most-cryptos-correlated-with-stocks-not-with-gold-analysts.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">correlated with stock markets</a>&nbsp;at the moment, meaning that they go down for the same reasons that stocks go down.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">[Banks and other financial institutions] treat bitcoin and crypto as a \'risk-on asset\', which means they tend to sell when they\'re nervous about the economy. The Ukraine conflict has been weighing heavily on stock markets for several weeks, and the crypto markets have gone down with them, said analyst Glen Goodman, author of&nbsp;<i>The Crypto Trader</i>.</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25; font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">What if war continues for months?</h2><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">With the war lasting almost a month, the question arises as to how it could undermine global markets, including crypto. Because with the conflict sending oil and gas prices to new highs, this inevitably has a knock-on effect on inflation and asset prices.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">The Ukraine conflict would normally be classed as a small war, but the impact of sanctions on Russia could have a more severe impact on the global economy. As crypto is tracking stocks closely, it feels the impact of these recessionary pressures, said Glen Goodman.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">But while analysts also expect the war to weigh down on stocks for as long it lasts, some say that it could have more positive effects on bitcoin.</p><blockquote style=\"margin-bottom: 40px; color: rgb(89, 0, 138); padding: 20px 0px 20px 28px; border-left: 2px solid rgb(89, 0, 138); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\"><p style=\"margin-bottom: 10px; font-family: &quot;Noto Serif&quot;, serif; font-size: 20px; font-style: italic;\">What\'s important in all of this is the political instability will once again highlight bitcoin\'s main goal of being a transparent, open-source, peer-to-peer network not controlled by a single administrator or central bank. This means that even if banks are closed and local currencies fall in value during times of instability, citizens will still have access to capital through crypto, said Simon Peters.</p></blockquote><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">This analysis is supported by&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/news/enormous-increase-ukraine-crypto-trading-volume-usd-47000-next-target-for-bitcoin-arcane.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">reports of a surge in cryptocurrency transactions</a>&nbsp;in Ukraine and Russia, driven by restrictions on withdrawals (in Ukraine) and also inflation (in Russia).</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">If the war deepens, some analysts suspect a recession could follow, which may in fact end up playing into bitcoins favor.&nbsp;</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">The war is likely to tilt the world into recession and I expect normal reversion of crude oil prices, toward USD 50 a barrel, along with the collapse of the Russian economy and related deflationary forces, which should enhance the value of bitcoin. The firstborn crypto is well on its way to becoming the global digital collateral benchmark, in a world going digital, said Mike McGlone.&nbsp;</p><h2 style=\"margin-top: 40px; margin-bottom: 40px; color: rgb(33, 33, 33); font-weight: 700; font-size: 24px; line-height: 1.25; font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Bitcoin and crypto as alternatives</h2><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Its possible that, the longer the war endures in Ukraine, the more people will be forced to use bitcoin and other cryptoassets. This has been reflected in the fact that Ukraines&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/news/ukraine-strengthens-its-positions-by-legalizing-bitcoin-crypto-heres-what-changes.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\">President Volodymyr Zelenskyy recently signed off</a>&nbsp;on a new law that grants legitimacy to cryptoassets, allowing exchanges to operate legally and recognizing the right of citizens to hold their wealth in the form of crypto.</p><blockquote style=\"margin-bottom: 40px; color: rgb(89, 0, 138); padding: 20px 0px 20px 28px; border-left: 2px solid rgb(89, 0, 138); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\"><p style=\"margin-bottom: 10px; font-family: &quot;Noto Serif&quot;, serif; font-size: 20px; font-style: italic;\">I think the narrative of bitcoin as an open, permissionless payments network has certainly been strengthened, for the good and bad, said Simon Peters.&nbsp;</p></blockquote><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Good in the sense that with traditional financial systems becoming less effective or being frozen out of them completely, crypto provides a way to be able to still move capital and transact, and also potentially a medium to protect wealth where the domestic currency is significantly becoming devalued.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">However, with fears that Russia and its oligarchs may attempt to&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer\" href=\"https://cryptonews.com/news/elliptic-claims-breakthrough-search-for-russsian-crypto-sanctions-evaders.htm\" style=\"color: rgb(89, 0, 138); background-color: transparent;\"><u>evade sanctions</u></a>&nbsp;via crypto, Peters also admits that this narrative is bad in the sense that an open, permissionless payments network could theoretically make economic punishments less effective. That said, he affirms that Bitcoin is fundamentally neutral, while it\'s also worth pointing out that its blockchain is completely public and transparent.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">For Mike McGlone, the continuation of the war could serve as a catalyst for what he expects will be bitcoins transition from a risk-on to a risk-off asset. He cites its relative outperformance in 2022 against the NASDAQ 100 Stock index as an indication of this, noting that its down about 19% vs. closer to 15% for bitcoin to March 14, despite the crypto trading with about 3x the volatility of the Nasdaq.&nbsp;</p><blockquote style=\"margin-bottom: 40px; color: rgb(89, 0, 138); padding: 20px 0px 20px 28px; border-left: 2px solid rgb(89, 0, 138); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\"><p style=\"margin-bottom: 10px; font-family: &quot;Noto Serif&quot;, serif; font-size: 20px; font-style: italic;\">Divergent strength is the takeaway for bitcoin. Once the dust settles on the overdue mean reversion process in the stock market, facing war and&nbsp;<span style=\"font-weight: bolder;\">Federal Reserve</span>&nbsp;restraint, bitcoin should come out ahead, he said.</p></blockquote><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">Of course, war -- much like the crypto market -- isnt amenable to exact predictions, so who knows how long this war in Europe will last and how badly it will impact the crypto. That said, the market\'s total capitalization is actually higher now than it was when Russian forces invaded Ukraine on February 24.</p><p style=\"margin-bottom: 30px; color: rgb(37, 37, 37); font-family: &quot;Noto Sans&quot;, sans-serif; letter-spacing: normal;\">But once again, the human costs of the war are something that can never be repaid.</p>', NULL, '2022-03-21 07:50:27', 1, 'the-ukraine-war-how-russias-aggression-affected-bitcoin-crypto-and-what-might-happen-next-1000x700.png', 'the-ukraine-war-how-russias-aggression-affected-bitcoin-crypto-and-what-might-happen-next-600x400.png', 'the-ukraine-war-how-russias-aggression-affected-bitcoin-crypto-and-what-might-happen-next-150x150.png', '2022-03-21 04:51:50', '2022-03-22 09:30:20', '<br>', NULL);
