INSERT INTO `email_templates` (`id`, `name`, `slug`, `subject`, `greeting`, `message`, `regards`, `notify`, `created_at`, `updated_at`) VALUES
(5, 'Welcome Email', 'welcome-email', 'Welcome to [[site_name]]', 'Hi [[user_name]],', 'Thanks for joining our platform! \n\nAs a member of our platform, you can mange your account, purchase cryptocurrencies, trade, referrals etc. \n\nFind out more about in - [[site_url]]', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(6, 'Send Email to User', 'send-user-email', 'New Message - [[site_name]]', 'Hi [[user_name]], ', 'You recieved a message from [[site_name]]:\r\n\r\n[[subject]]\r\n\r\n[[message]]\r\n\r\n', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(16, 'Balance Add by Admin', 'balance-add-by-admin', 'Your Account has been Credited by Admin - [[site_name]]', 'Hello [[user_name]],', '[[amount]] [[currency]] has been added to your account .\r\n\r\nTransaction Number : [[trx]]\r\n\r\nYour Current Balance is : [[post_balance]]  [[currency]]\r\n\r\n', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:12:31'),
(8, 'Unusual Login Email', 'users-unusual-login-email', 'Unusual Login Attempt on [[site_name]]!!!!', 'Hi [[user_name]], ', 'Someone tried to log in too many times in your [[site_name]] account.', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(9, 'Automated Deposit - Successful', 'automated-deposit-successful', 'Deposit Completed Successfully - [[site_name]]', 'Hi [[user_name]],', 'Your deposit of [[amount]] [[currency]] is via  [[method_name]] has been completed Successfully.\r\n\r\nDetails of your Deposit :\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nPayable : [[method_amount]] [[method_currency]]\r\nPaid via :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\nYour current Balance is [[post_balance]] [[currency]]\r\n\r\n', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:11:22'),
(1, 'KYC Approved Email', 'kyc-approved-email', 'KYC Verified: Trade in [[site_name]]', 'Hello [[user_name]],', 'Thank you for submitting your verification request. \r\n\r\nWe are pleased to let you know that your identity (KYC) has been verified and you are granted to participate in our trading platform with your wallet.\r\n\r\nWe invite you to get back to your account dashboard and start trading.', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:09:48'),
(2, 'KYC Rejected Email', 'kyc-rejected-email', 'KYC Application has been rejected - [[site_name]]', 'Hello [[user_name]],', 'Thank you for submitting your verification request. We\'re having difficulties verifying your identity. \r\n\r\nThe information you had submitted was unfortunately rejected for the following reasons: \r\n[[message]]\r\n\r\nDon\'t be upset! Still, if you want to verify your identity, please get back to your account and fill out the form with proper information and upload the correct documents to complete your identity verification process.', 'true', 0, '2021-07-10 21:37:21', '2022-04-21 15:29:52'),
(3, 'KYC Missing Email', 'kyc-missing-email', 'Identity Verification: Action Required - [[site_name]]', 'Hello [[user_name]],', 'Thank you for submitting your verification request. We\'re having difficulties verifying your identity. \n\nThe information you had submitted was unfortunately rejected because of the following reason:\n[[message]]\n\nWe request to get back to your account in order to upload new documents and complete the identity verification.', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(4, 'KYC Submitted Email', 'kyc-submit-email', 'Document submitted for Identity Verification - [[site_name]]', 'Hello [[user_name]],', 'Thank you for submitting your verification request. We\'ve received your submitted document and other information for identity verification.\n\nWe\'ll review your information and if all is in order will approve your identity. If the information is incorrect or something missing, we will request this as soon as possible.', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(7, 'Support Ticket Reply', 'support-ticket-reply', 'Support Ticket Reply  - [[site_name]]', 'Hi [[user_name]],', 'A member from our support team has replied to the following ticket:\r\n\r\n[Ticket#[[ticket_id]]] [[ticket_subject]]\r\n\r\nClick here to reply:  [[link]]\r\n\r\n----------------------------------------------\r\n\r\nHere is the reply :\r\n\r\n[[reply]]\r\n\r\n', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:10:16'),
(10, 'Manual Deposit - User Requested', 'manual-deposit-user-requested', 'Deposit Request Submitted Successfully - [[site_name]]', 'Hi [[user_name]],', 'Your deposit request of [[amount]] [[currency]] is via  [[method_name]] submitted successfully .\r\n\r\nDetails of your Deposit :\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nPayable : [[method_amount]] [[method_currency]]\r\nPay via :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\n', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:11:12'),
(17, 'Balance Subtracted by Admin', 'balance-subtracted-by-admin', 'Your Account has been Debited by Admin - [[site_name]]', 'Hello [[user_name]],', '[[amount]] [[currency]] has been subtracted from your account .\r\n\r\nTransaction Number : [[trx]]\r\n\r\nYour Current Balance is : [[post_balance]]  [[currency]]\r\n\r\n', 'true', 1, '2021-07-10 21:37:21', '2021-12-27 19:11:54'),
(11, 'Manual Deposit - Admin Approved	', 'manual-deposit-admin-approved', 'Your Deposit is Approved', 'Hi [[user_name]],', 'Your deposit request of [[amount]] [[currency]] is via  [[method_name]] is Approved .\r\n\r\nDetails of your Deposit :\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nPayable : [[method_amount]] [[method_currency]]\r\nPaid via :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\nYour current Balance is [[post_balance]] [[currency]]\r\n\r\n', 'true', 1, '2021-07-10 21:37:21', '2021-07-10 21:37:21'),
(12, 'Manual Deposit - Admin Rejected', 'manual-deposit-admin-rejected', 'Your Deposit Request is Rejected - [[site_name]]', 'Hi [[user_name]],', 'Your deposit request of [[amount]] [[currency]] is via  [[method_name]] has been rejected.\r\n\r\nTransaction Number was : [[trx]]\r\n\r\nif you have any query, feel free to contact us.\r\n\r\n\r\n\r\n[[rejection_message]]\r\n\r\n', 'true', 1, '2021-07-10 21:37:21', '2021-12-27 19:12:18'),
(13, 'Withdraw - User Requested', 'withdraw-user-requested', 'Withdraw Request Submitted Successfully - [[site_name]]', 'Hi [[user_name]],', 'Your withdraw request of [[amount]] [[currency]]  via  [[method_name]] has been submitted Successfully.\r\n\r\nDetails of your withdraw:\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nYou will get: [[method_amount]] [[method_currency]]\r\nVia :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\nThis may take [[delay]] to process the payment.\r\n\r\n\r\nYour current Balance is [[post_balance]] [[currency]]\r\n\r\n', 'true', 0, '2021-07-10 21:37:21', '2021-12-27 19:11:38'),
(14, 'Withdraw - Admin Rejected', 'withdraw-admin-rejected', 'Withdraw Request has been Rejected and your money is refunded to your account - [[site_name]]', 'Hi [[user_name]],', 'Your withdraw request of [[amount]] [[currency]]  via  [[method_name]] has been Rejected.\r\n\r\nDetails of your withdraw:\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nYou should get: [[method_amount]] [[method_currency]]\r\nVia :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\n\r\n----\r\n\r\n[[amount]] [[currency]] has been refunded to your account and your current Balance is [[post_balance]] [[currency]]\r\n\r\n-----\r\n\r\nDetails of Rejection :\r\n[[admin_details]]\r\n\r\n', 'true', 1, '2021-07-10 21:37:21', '2021-12-27 19:12:10'),
(15, 'Withdraw - Admin Approved', 'withdraw-admin-approved', 'Withdraw Request has been Processed and your money is sent - [[site_name]]', 'Hi [[user_name]],', 'Your withdraw request of [[amount]] [[currency]]  via  [[method_name]] has been Processed Successfully.\r\n\r\nDetails of your withdraw:\r\n\r\nAmount : [[amount]] [[currency]]\r\nCharge: [[charge]] [[currency]]\r\n\r\nConversion Rate : 1 [[currency]] = [[rate]] [[method_currency]]\r\nYou will get: [[method_amount]] [[method_currency]]\r\nVia :  [[method_name]]\r\n\r\nTransaction Number : [[trx]]\r\n\r\n-----\r\n\r\nDetails of Processed Payment :\r\n[[admin_details]]', 'true', 1, '2021-07-10 21:37:21', '2022-01-02 09:57:10');
